import React from 'react'
import {Text, View , TouchableOpacity , Image,} from 'react-native';

const Register = () => {
  return (
    <KeyboardAvoidingView
    styles={styles.container}
    behavior="padding"
    >
        <Text>Register</Text>
    </KeyboardAvoidingView>
  )
}

export default Register;
